import axios from "axios";
import { useEffect, useState } from "react";


const Users = () => {

    const [users, setUsers] = useState([{
        username: "",
        email: ""
    }])

    useEffect(()=>{
        axios.get("http://localhost:3005/register/users")
        .then((response)=>console.log("response", response))
    },[]) 

    return(
        <div>
            Users
        </div>
    )
}

export default Users;
